DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `getaulas`(IN num INT , IN cad VARCHAR(10))
BEGIN
    SELECT * FROM aulas WHERE puestos>= num AND nombreAula LIKE CONCAT("%",cad,"%");
END//
DELIMITER ;

