DELIMITER //
CREATE DEFINER=`root`@`localhost` FUNCTION `SUMA`() RETURNS int(11)
BEGIN
	DECLARE cant INT DEFAULT 0;
   SELECT SUM(puestos) INTO cant FROM aulas;
   return cant;
END//
DELIMITER ;

CREATE TABLE IF NOT EXISTS `alumnos` (
  `codigo` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(14) NOT NULL,
  `apellidos` varchar(14) NOT NULL,
  `altura` int(11) DEFAULT NULL,
  `aula` int(11) DEFAULT NULL,
  PRIMARY KEY (`codigo`),
  KEY `aula` (`aula`),
  CONSTRAINT `alumnos_ibfk_1` FOREIGN KEY (`aula`) REFERENCES `aulas` (`numero`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

