CREATE TABLE IF NOT EXISTS `notas` (
  `alumno` int(11) NOT NULL,
  `asignatura` int(2) NOT NULL,
  `NOTA` int(2) DEFAULT NULL,
  `fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`alumno`,`asignatura`,`fecha`),
  KEY `alumno` (`alumno`),
  KEY `asignatura` (`asignatura`),
  CONSTRAINT `notas_ibfk_1` FOREIGN KEY (`alumno`) REFERENCES `alumnos` (`codigo`) ON UPDATE CASCADE,
  CONSTRAINT `notas_ibfk_2` FOREIGN KEY (`asignatura`) REFERENCES `asignaturas` (`COD`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

